import React from 'react';
import { useLocation } from 'react-router-dom';

function ResultPage() {
    const location = useLocation();  // Garanta que `useLocation` está sendo importado e usado corretamente
    const result = location.state ? location.state.result : { petshop: 'N/A', totalCost: 'N/A' };

    return (
        
        <div>
            <h1>Resultado</h1>
            <p>Petshop: {result.petshop}</p>
            <p>Custo Total: R$ {result.totalCost}</p>
        </div>
    );
}

export default ResultPage;
